def min_stamps(total_postage, denominations):
    """"""
    dp = [float('inf')] * (total_postage + 1)
    dp[0] = 0
    for i in range(1, total_postage + 1):
        for denom in denominations:
            if denom <= i:
                dp[i] = min(dp[i], dp[i - denom] + 1)
    return dp[total_postage]
